// JoinedStudent.js
import React, { useEffect, useState } from "react";
import Navbar from "../Tutor/NavTutor";
import { Row } from "react-bootstrap";
import "../style/JoinedStudent.css"; // Import CSS untuk gaya yang sudah dibuat

const JoinedStudent = () => {
  const [joins, setJoins] = useState([]);

  useEffect(() => {
    const fetchJoins = async () => {
      try {
        const response = await fetch("http://localhost:5000/tutor/joins", {
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${localStorage.getItem("access_token")}`,
          },
        });
        if (response.ok) {
          const data = await response.json();
          setJoins(data);
        } else {
          console.error("Failed to fetch joins");
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };

    fetchJoins();
  }, []);

  return (
    <div className="joined-student">
      <Navbar />
      <h1>Students Joined</h1>
      <Row>
        <div className="content">
          {joins.map((join) => (
            <div key={join.join_id} className="profile-card">
              <strong>Name: 
                <p>{join.student_name}</p>
                </strong>
              <strong>Email: 
                {join.student_email}
                </strong>
              <strong>
                Class Title: 
                {join.class_title}
                </strong>
            </div>
          ))}
        </div>
      </Row>
    </div>
  );
};

export default JoinedStudent;
